import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import {connect} from 'react-redux';
import afiche from '../images/afiche.png'
import {logout} from '../store/actions/auth'


class Navbar extends Component {
  logout = e => {
    e.preventDefault();
    this.props.logout();
  }
  render(){
    return(
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <div className="container-fluid">
            <Link to="/" className="navbar-brand">
              <img src={afiche} alt="Nutric.io" className="miafiche"/>
            </Link>
          </div>
          {this.props.currentUser.isAuthenticated ? (
            <ul className='nav navbar-nav navbar-right'>
              <li>
                <Link to={`/users/${this.props.currentUser.user.id}/messages/new`}>Registrar nuevo paciente</Link>
              </li>
              <li>
                <a onClick={this.logout}>Cerrar sesión</a>
              </li>
            </ul>
          ) : (
            <ul className="nav navbar-nav navbar-right">
              <li>
                <Link to="/signup">Regístrate</Link>
              </li>
              <li>
                <Link to="/login">Inicia Sesión</Link>
              </li>
            </ul>
          )
          }
        </nav>
      )
  }
}

function mapStateToProps(state){
  return {
    currentUser: state.currentUser
  }
}

export default connect(mapStateToProps, {logout})(Navbar);
